import React, { Component } from 'react';
import Validation from './Validation';
import Input from './input';

class Testpage extends Component {
    constructor(props){
        super(props);

    }

    render() {
        return (
            <div>
                <Validation />
                <Input name="Umakant" value={this.name.email}/>
            </div>
        );
    }
}

export default Testpage;
